import Head from "next/head";
import App from "next/app";

import "../styles/base.scss";


export default class MyApp extends App {

    render() {
        const { 
            pageProps, 
            Component
        } = this.props;

        return (
            <>
                <Head>
                    <title>Next Passport Auth</title>
                    <link rel="icon" href="/favicon.ico" />
                </Head>
                <Component {...pageProps} />
            </>
        )
    }
}
